import React from "react";

function Cart({ items }) {
  return (
    <>
      <div className="cart">
        <div>Cart Items</div>
      </div>
      <div>
        {items.map((cartitem) => (
          <div key={cartitem.id}></div>
        ))}
      </div>
    </>
  );
}

export default Cart;
